import React from "react";

class Product extends React.Component {
    render() {
        return (
            sampleData = [
                {
                    id: 0,
                    icon: "folder-close",
                    label: "Folders",
                    depth: 1,
                    childNodes: [
                        {
                            id: 3,
                            icon: "document",
                            label: "Folder 1"
                        },
                        {
                            id: 4,
                            icon: "document",
                            label: "Folder 2"
                        },
                    ]
                },
                {
                    id: 1,
                    icon: "user",
                    label: "Profile"
                },
                {
                    id: 2,
                    icon: "folder-close",
                    label: "Documents"
                },
            ]
        );
    }
}

export default Product;
